import { BrowserRouter as Router,Route,Switch } from "react-router-dom";
import Home from "./Views/Home/Home";

function Routers() {
    return (
        <div>
            <Router>
                <Switch>
                    <Route path='/' component={Home} />
                </Switch>
            </Router>
        </div>
    )
}

export default Routers
